#include<bits/stdc++.h>
#include<vector>
using namespace std;

int numSub(string s) {
    for(int i = 0; i < s.length(); i++)
        if(s[i] == '0') s[i] = ' ';
    stringstream ss(s);
    string token;
    long long res = 0;
    while(ss >> token){
        long long sz = token.length();
        cout << sz <<endl;
        if(sz%2 == 0)
            res += (sz+1)*(sz/2);
        else 
            res += ((sz+1)/2) * sz;
    }        
    return res;
}

int main(){
    cout << numSub("");
    return 0;
}